e}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="cPikIPdrlsdmTkmVFea59LndthQ"  nonce="cPikIPdrlsdmTkmVFea59LndthQ">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="cPikIPdrlsdmTkmVFea59LndthQ"  nonce="cPikIPdrlsdmTkmVFea59LndthQ">DOCS_modelChunk = [{"ty":"is","ibi":5145,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cit and why it works.”3 In 2009 Netflix announced a winner: a seven-person team made up of statisticians and computer scientists from the United States, Austria, Canada, and Israel. Alas, I cannot describe the winning system, even in an appendix. The paper explaining the system is ninety-two pages long.* I’m impressed by the quality of the Netflix recommendations. Still, the system is just a super fancy variation on what people have been doing since the dawn of film: find someone with similar tastes and ask for a recommendation. You tend to like what I like, and to dislike what I dislike, so what did you think of the new George Clooney film? That is the essence of correlation\n\nJune 18, 2017\n\u001c84\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cJune 18, 2017\n\u001c85\n\u0011\n\u0011\n\n\n5 Basic Probability: Don’t buy the extended warranty on your $99 printer\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cJune 19, 2017\n\u001c103\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cLet’s look at what that means. A total of 19,250 people are notified that they have the disease; only 9 percent of them are actually sick! And that’s with a test that has a very low rate of false positives. Without going too far off topic, this should give you some insight into why cost containment in health care sometimes involves less screening of healthy people for diseases, not more. In the case of a disease like HIV/AIDS, public health officials will often recommend that the resources available be used to screen the populations at highest risk, such as gay men or intravenous drug users.\n\nJanuary 1, 2015\n\u001c105\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe Santa Cruz system was designed by two mathematicians, an anthropologist, and a criminologist. The Chicago Police Department has created an entire predictive analytics unit, in part because gang activity, the source of much of the city’s violence, follows certain patterns. The book Data Mining and Predictive Analysis: Intelligence Gathering and Crime Analysis , a guide to statistics for law enforcement, begins enthusiastically, “It is now possible to predict the future when it comes to crime, such as identifying crime trends, anticipating hotspots in the community, refining resource deployment decisions, and ensuring the greatest protection for citizens in the most efficient manner.” (Look, I read these kinds of things so that you don’t have to.)\n\nJanuary 1, 2015\n\u001c106\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cTexting while driving causes crashes, but state laws banning the practice do not seem to stop drivers from doing it. In fact, such laws might even make things worse by prompting drivers to hide their phones and therefore take their eyes off the road while texting.\n\nJanuary 1, 2015\n\u001c107\n\u0011\n\u0011\n\n\n8 The Central Limit Theorem: The Lebron James of statistics\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cJanuary 1, 2015\n\u001c155\n\u0011\n\u0011\n\n\n9 Inference: Why my statistics professor thought I might have cheated\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cNow that I’ve taught for many years, I’m more sympathetic to his line of thinking. In nearly every course I’ve taught, there is a striking degree of correlation between a student’s performance on the midterm and on the final. It is highly unusual for a student to score below average on the midterm and then near the top of the class on the final. I explained that I had finished my thesis and gotten serious about the class (by\n\nJanuary 2, 2015\n\u001c170\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cTo be more precise, any statistical inference begins with an implicit or explicit null hypothesis. This is our starting assumption, which will be rejected or not on the basis of subsequent statistical analysis.\n\nJanuary 2, 2015\n\u001c172\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cNull hypothesis: This new experimental drug is no more effective at preventing malaria than a placebo. Alternative hypothesis: This new experimental drug can help to prevent malaria.\n\nJanuary 2, 2015\n\u001c173\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cOne of the most common thresholds that researchers use for rejecting a null hypothesis is 5 percent, which is often written in decimal form: .05. This probability is known as a significance level, and it represents the upper bound for the likelihood of observing some pattern of data if the null hypothesis were true. Stick with me for a moment, because it’s not really that complicated.\n\nJanuary 2, 2015\n\u001c176\n\u0011\n\u0011"},{"ty":"te","id":"i.12","spi":5154},{"ty":"te","id":"i.13","spi":5872},{"ty":"te","id":"i.14","spi":5980},{"ty":"te","id":"i.15","spi":6014},{"ty":"te","id":"i.16","spi":6650},{"ty":"te","id":"i.17","spi":7447},{"ty":"te","id":"i.18","spi":7811},{"ty":"te","id":"i.19","spi":7919},{"ty":"te","id":"i.20","spi":8385},{"ty":"te","id":"i.21","spi":8633},{"ty":"te","id":"i.22","spi":8853},{"ty":"as","st":"paragraph","si":5145,"ei":5145,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"paragraph","si":5146,"e