f","ts_it_i":false,"ts_bgc":"#93e3ed","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":8352,"ei":8368,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":8388,"ei":8599,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#93e3ed","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":8600,"ei":8616,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":8636,"ei":8819,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#ffb8a1","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":8820,"ei":8836,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":8856,"ei":9244,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#fde096","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":9245,"ei":9261,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="cPikIPdrlsdmTkmVFea59LndthQ"  nonce="cPikIPdrlsdmTkmVFea59LndthQ">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="cPikIPdrlsdmTkmVFea59LndthQ"  nonce="cPikIPdrlsdmTkmVFea59LndthQ">DOCS_modelChunk = [{"ty":"is","ibi":9269,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cLet’s think about a significance level of .05. We can reject a null hypothesis at the .05 level if there is less than a 5 percent chance of getting an outcome at least as extreme as what we’ve observed if the null hypothesis were true.\n\nJanuary 2, 2015\n\u001c176\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cJanuary 2, 2015\n\u001c191\n\u0011\n\u0011\n\n\n10 Polling: How we know that 64 percent of Americans support the death penalty (with a sampling error ± 3 percent)\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIs this an accurate sample of the population whose opinions we are trying to measure? Many common data-related challenges were discussed in Chapter 7. Nonetheless, I will point out once again the danger of selection bias, particularly self-selection. Any poll that depends on individuals who select into the sample, such as a radio call-in show or a voluntary Internet survey, will capture only the views of those who make the effort to voice their opinions\n\nJanuary 2, 2015\n\u001c207\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cOne indicator of a poll’s validity is the response rate: What proportion of respondents who were chosen to be contacted ultimately completed the poll or survey? A low response rate can be a warning sign for potential sampling bias. The more people there are who opt not to answer the poll, or who just can’t be reached, the greater the possibility that this large group is different in some material way from those who did answer the questions.\n\nJanuary 2, 2015\n\u001c209\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cHave the questions been posed in a way that elicits accurate information on the topic of interest? Soliciting public opinion requires more nuance than measuring test scores or putting respondents on a scale to determine their weight. Survey results can be extremely sensitive to the way a question is asked.\n\nJanuary 2, 2015\n\u001c209\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIf pollsters are to be considered honest brokers generating legitimate results, they must guard against language that is prone to affect the accuracy of the information collected. Similarly, if answers are to be compared over time—such as how consumers feel about the economy today compared with how they felt a year ago\n\nJanuary 2, 2015\n\u001c210\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cthen the questions eliciting that information over time must be the same, or very similar\n\nJanuary 2, 2015\n\u001c210\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cTo experts like Gallup’s Frank Newport, the answers to every question present meaningful data, even when those answers may appear to be inconsistent. 3 The fact that American attitudes toward capital punishment change dramatically when life without parole is offered as an option tells us something important. The key point, says Newport, is to view any polling result in context. No single question or poll can capture the full depth of public opinion on a complex issue\n\nJanuary 2, 2015\n\u001c210\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWe know that people shade the truth, particularly when the questions asked are embarrassing or sensitive. Respondents may overstate their income, or inflate the number of times they have sex in a typical month. They may not admit that they do not vote. They may hesitate to express views that are unpopular or socially unacceptable. For all these reasons, even the most carefully designed poll is dependent on the integrity of the respondents’ answers. Election polls depend crucially\n\nJanuary 2, 2015\n\u001c211\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cOne way to minimize this potential bias is to ask whether a respondent voted in the last election, or in the last several elections. Respondents who have voted consistently in the past are most likely to vote in the future. Similarly, if there are concerns that respondents may be hesitant to express a socially unacceptable answer, such as a negative view of a racial or ethnic group, the question may be phrased in a more subtle way, such as by asking “if people you know” hold such an opinion.\n\nJanuary 2, 2015\n\u001c211\n\u0011\n\u0011\n\n\n11 Regression Analysis: The miracle elixir\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cfound that workers who have little control over their jobs—meaning they have minimal say over what tasks are performed or how those tasks are carried out—have a significantly higher mortality rate than other workers in the civil service with more decision-making authority. According to this research, it is not the stress associated with major responsibilities that will kill you; it is the stress associated with being told what to do while having little say in how or when it gets done\n\nJanuary 11, 2015\n\u001c216\n\u0011\n\u0011"},{"ty":"te","id":"i.23","spi":9278},{"ty":"te","id":"i.24","spi":9551},{"ty":"te","id":"i.25","spi":9704},{"ty":"te","id":"i.26","spi":10199},{"ty":"te","id":"i.27","spi":10681},{"ty":"te","id":"i.28","spi":11026},{"ty":"te","id":"i.29","spi":11384},{"ty":"te","id":"i.30","spi":11511},{"ty":"te","id":"i.31","spi":12020},{"ty":"te","id":"i.32","spi":12542},{"ty":"te","id":"i.33","spi":13121},{"ty":"as","st":"paragraph","si":9269,"ei":9269,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"paragraph","si":9270,"ei":9270,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"tbl","si