e}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="cPikIPdrlsdmTkmVFea59LndthQ"  nonce="cPikIPdrlsdmTkmVFea59LndthQ">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="cPikIPdrlsdmTkmVFea59LndthQ"  nonce="cPikIPdrlsdmTkmVFea59LndthQ">DOCS_modelChunk = [{"ty":"is","ibi":13639,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIs “low job control” really causing heart disease? Or is it some combination of other factors that happen to be shared by people with low job control, in which case we may be completely missing the real public health threat. Regression analysis is the statistical tool that helps us deal with this challenge. Specifically, regression analysis allows us to quantify the relationship between a particular variable and an outcome that we care about while controlling for other factors.\n\nJanuary 11, 2015\n\u001c217\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cAt its core, regression analysis seeks to find the “best fit” for a linear relationship between two variables\n\nJanuary 11, 2015\n\u001c221\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cBut how do we know which is the best line for these data? In fact, how exactly would we define “best”? Regression analysis typically uses a methodology called ordinary least squares, or OLS. The technical details, including why OLS produces the best fit, will have to be left to a more advanced book. The key point lies in the “least squares” part of the name; OLS fits the line that minimizes the sum of the squared residuals. That’s not as awfully complicated as it sounds. Each observation in our height and weight data set has a residual, which is its vertical distance from the regression\n\nJanuary 11, 2015\n\u001c221\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cHowever, I must warn that when we are working with a small sample of data—such as a group of 20 adults rather than the 3,000+ persons in the Changing Lives study—the normal distribution is no longer willing to be our friend. Specifically, if we repeatedly conduct regression analysis on different small samples, we can no longer assume that our various coefficients will be distributed normally around the “true” association between height and weight in the American adult population. Instead, our coefficients will still be distributed around the “true” association between height and weight for the American adult population in what is known as a t-distribution. (Basically the t-distribution is more dispersed than the normal distribution and therefore has “fatter tails.”) Nothing else changes;\n\nJanuary 11, 2015\n\u001c227\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cRemember, we have not proved that taller people weigh more in the general population; we have merely shown that our results for the Changing Lives sample would be highly anomalous if that were not the case\n\nJanuary 11, 2015\n\u001c229\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cR 2 tells us how much of that variation around the mean is associated with\n\nJanuary 11, 2015\n\u001c230\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cdifferences in height alone. The answer in our case is .25, or 25 percent. The more significant point may be that 75 percent of the variation in weight for our sample remains unexplained. There are clearly factors other than height that might help us understand the weights of the Changing Lives participants.\n\nJanuary 11, 2015\n\u001c230\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cRegression analysis (often called multiple regression analysis when more than one explanatory variable is involved, or multivariate regression analysis) will give us a coefficient for each explanatory variable included in the regression equation. In other words, among people who are the same sex and height , what is the relationship between age and weight?\n\nJanuary 11, 2015\n\u001c230\n\u0011\n\u0011\n\n\n12 Common Regression Mistakes: The mandatory warning label\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe New York Times Magazine asked a delicate but socially significant question: How many women died prematurely or suffered strokes or breast cancer because they were taking a pill that their doctors had prescribed to keep them healthy? The answer: “A reasonable estimate would be tens of thousands.” 3\n\nJanuary 12, 2015\n\u001c247\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cOn the other hand, states that have strong economies can afford to spend more on K–12 education, so the strong economy could be causing the education spending. Or, education spending could boost economic growth, which makes possible additional education spending—the causality could be going in both ways. The point is that we should not use explanatory variables that might be affected by the outcome that we are trying to explain, or else the results will become hopelessly tangled. For example, it would be inappropriate to use the unemployment rate in a regression equation explaining GDP growth, since unemployment is clearly affected by the rate of GDP growth.\n\nJanuary 12, 2015\n\u001c251\n\u0011\n\u0011"},{"ty":"te","id":"i.34","spi":13648},{"ty":"te","id":"i.35","spi":14169},{"ty":"te","id":"i.36","spi":14317},{"ty":"te","id":"i.37","spi":14949},{"ty":"te","id":"i.38","spi":15786},{"ty":"te","id":"i.39","spi":16030},{"ty":"te","id":"i.40","spi":16143},{"ty":"te","id":"i.41","spi":16491},{"ty":"te","id":"i.42","spi":16949},{"ty":"te","id":"i.43","spi":17290},{"ty":"as","st":"paragraph","si":13639,"ei":13639,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_