true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#c5e1a5","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":17961,"ei":17978,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="cPikIPdrlsdmTkmVFea59LndthQ"  nonce="cPikIPdrlsdmTkmVFea59LndthQ">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="cPikIPdrlsdmTkmVFea59LndthQ"  nonce="cPikIPdrlsdmTkmVFea59LndthQ">DOCS_modelChunk = [{"ty":"is","ibi":17986,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWe should have reason to believe that our explanatory variables affect the dependent variable, and not the other way around.\n\nJanuary 12, 2015\n\u001c251\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe bigger concern should be whether or not the SAT is “coachable.” How much can students improve their scores by taking private\n\nJanuary 12, 2015\n\u001c253\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cSAT prep classes? Wealthy families clearly are better able to send their children to test prep classes. Any causal improvement between these classes and SAT scores would favor students from wealthy families relative to more disadvantaged students of equal abilities (who presumably also could have raised their scores with a prep class but never had that opportunity).\n\nJanuary 12, 2015\n\u001c253\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cHighly correlated explanatory variables (multicollinearity) . If a regression equation includes two or more explanatory variables that are highly correlated with each other, the analysis will not necessarily be able to discern the true relationship between each of those variables and the outcome that we are trying to explain\n\nCompetency clusters hypothesis\n\nJanuary 12, 2015\n\u001c253\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWe are unlikely to get meaningful coefficients on either the cocaine or the heroin variable; we may also obscure the larger and more important relationship between SAT scores and using either one of these drugs. When two explanatory variables are highly correlated, researchers will usually use one or the other in the regression equation, or they may create some kind of composite variable, such as “used cocaine or heroin.”\n\nJanuary 12, 2015\n\u001c254\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThis phenomenon can plague even legitimate research. The accepted convention is to reject a null hypothesis when we observe something that would happen by chance only 1 in 20 times or less if the null hypothesis were true. Of course, if we conduct 20 studies, or if we include 20 junk variables in a single regression equation, then on average we will get 1 bogus statistically significant finding. The New York Times Magazine captured this tension wonderfully in a quotation from Richard Peto, a medical statistician and epidemiologist: “Epidemiology is so beautiful and provides such an important perspective on human life and death, but an incredible amount of rubbish is published\n\nJanuary 12, 2015\n\u001c257\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cJournal ran a front-page story on what it described as one of the “dirty little secrets” of medical research: “Most results, including those that appear in top-flight peer-reviewed journals, can’t be reproduced.” 7 (A peer-reviewed journal is a publication in which studies and articles are reviewed for methodological soundness by other experts in the same field before being approved for publication; such publications are considered to be the gatekeepers for academic research.) One reason for this “dirty little secret” is the positive publication bias described in Chapter 7. If researchers and medical journals pay attention to positive findings and ignore negative findings, then they may well publish the one study that finds a drug effective and ignore the nineteen in which it has no effect. Some clinical trials may also have small samples (such as for a rare diseases), which magnifies the chances t\n\nJanuary 12, 2015\n\u001c257\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cFirst, designing a good regression equation—figuring out what variables should be examined and where the data should come from—is more important than the underlying statistical calculations. This process is referred to as estimating the equation, or specifying a good regression equation. The best researchers are the ones who can think logically about what variables ought to be included in a regression equation, what might be missing, and how the eventual results can and should be interpreted. Second, like most other statistical inference, regression analysis builds only a circumstantial case. An association between two variables is like a fingerprint at the scene of the crime. It points us in the right direction, but it’s rarely enough to convict. (And sometimes a fingerprint at the scene of a crime doesn’t belong to the perpetrator.) Any regression analysis needs a theoretical underpinning:\n\nJanuary 12, 2015\n\u001c259\n\u0011\n\u0011"},{"ty":"te","id":"i.44","spi":17995},{"ty":"te","id":"i.45","spi":18158},{"ty":"te","id":"i.46","spi":18325},{"ty":"te","id":"i.47","spi":18732},{"ty":"te","id":"i.48","spi":19129},{"ty":"te","id":"i.49","spi":19593},{"ty":"te","id":"i.50","spi":20316},{"ty":"te","id":"i.51","spi":21266},{"ty":"as","st":"paragraph","si":17986,"ei":17986,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":tru