_bgc":"#93e3ed","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":22175,"ei":22192,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="cPikIPdrlsdmTkmVFea59LndthQ"  nonce="cPikIPdrlsdmTkmVFea59LndthQ">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="cPikIPdrlsdmTkmVFea59LndthQ"  nonce="cPikIPdrlsdmTkmVFea59LndthQ">DOCS_modelChunk = [{"ty":"is","ibi":22200,"s":"\n\n\n13 Program Evaluation: Will going to Harvard change your life?\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWelcome to program evaluation, which is the process by which we seek to measure the causal effect of some intervention—anything from a new cancer drug to a job placement program for high school dropouts. Or putting more police officers on the street. The intervention that we care about is typically called the “treatment,” though that word is used more expansively in a statistical context than in normal parlance\n\nJanuary 12, 2015\n\u001c262\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe point is that we are seeking to isolate the effect of that single factor; ideally we would like to know how the group receiving that treatment fares compared with some other group whose members are identical in all other respects but for the treatment. Program evalu\n\nJanuary 12, 2015\n\u001c263\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cHere is how Jonathan Klick and Alexander Tabarrok, researchers at the University of Pennsylvania and George Mason University, respectively, studied how putting more police officers on the street affects the crime rate. Their research strategy made use of the terrorism alert system. Specifically, Washington, D.C., responds to “high alert” days for terrorism by putting more officers in certain areas of the city, since the capital is a natural terrorism target. We can assume that there is no relationship between street crime and the terrorism threat, so this boost in the D.C. police presence is unrelated to the conventional crime rate, or “exogenous.” The researchers’ most valuable insight was recognizing the natural experiment here: What happens to ordinary crime on terrorism “high alert” days? The answer: The number of crimes committed when the terrorism threa\n\nJanuary 12, 2015\n\u001c263\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cwas Orange (high alert and more police) was roughly 7 percent lower than when the terrorism threat level was Yellow (elevated alert but no extra law enforcement precautions). The authors also found that the decrease in crime was sharpest in the police district that gets the most police attention on high-alert days (because it includes the White House, the Capitol, and the National Mall). The important takeaway is that we can answer tricky but socially meaningful questions—we just have to be clever about it. Here are some of the most common approaches for isolating a treatment effect. Randomized\n\nJanuary 12, 2015\n\u001c263\n\u0011\n\u0011"}}'






